import "./App.css";
import Translate from "./components/Translate";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <span className="left-container">
          <Translate></Translate>
        </span>
        <span className="right-container"></span>
      </header>
    </div>
  );
}

export default App;
